import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom"
import Home from "./pages/Home";



function Rotas() {
    return (

        <BrowserRouter>
            <Routes>
                <Route path="/" exact element={<Home />} />
                <Route path="/cadastro" exact element={<Cadastro />} />
            </Routes>
        </BrowserRouter>

    );
}

export default Rotas;
